
CREATE TABLE IF NOT EXISTS `b2b_region` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `level` tinyint(10) NOT NULL DEFAULT '0' COMMENT '0顶级',
  `immchildnum` int(10) NOT NULL DEFAULT '0' COMMENT '直系孩子数',
  `number` varchar(30) NOT NULL DEFAULT '0' COMMENT 'QQ获取的城市编号',
  `name` varchar(40) DEFAULT '0',
  `fullname` varchar(30) NOT NULL DEFAULT '0' COMMENT '全称',
  `pinyin` varchar(100) NOT NULL DEFAULT '0' COMMENT '简称的拼音',
  `lat` varchar(20) NOT NULL DEFAULT '0' COMMENT '经度',
  `lng` varchar(20) NOT NULL DEFAULT '0' COMMENT '纬度',
  `father` varchar(6) NOT NULL DEFAULT '0',
  `createtime` int(11) NOT NULL DEFAULT '0',
  `createtimestr` varchar(19) NOT NULL DEFAULT '0' COMMENT '时间串',
  `buddhastatus` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0正常1禁用',
  `isdel` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0正常1删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=3636 ;

